Actionscript.script:
stop();
_root.warpframe = false;
hit = true;
onEnterFrame = function () {
	if (this.warp1.hitTest(_root.Course.Char.charClip.feet)) {
		_root.Course.Char.attack = true;
		_root.Course.Char.xspeed = 0;
		_root.Course.Char.yspeed = 0;
		_root.Course.Char.attackFrame = "none";
		warp = true;
		warpnum = 1;
	}
	if (this.warp2.hitTest(_root.Course.Char.charClip.feet)) {
		_root.Course.Char.attack = true;
		_root.Course.Char.xspeed = 0;
		_root.Course.Char.yspeed = 0;
		_root.Course.Char.attackFrame = "none";
		warp = true;
		warpnum = 2;
	}
	if (this.warp3.hitTest(_root.Course.Char.charClip.feet)) {
		_root.Course.Char.attack = true;
		_root.Course.Char.xspeed = 0;
		_root.Course.Char.yspeed = 0;
		_root.Course.Char.attackFrame = "none";
		warp = true;
		warpnum = 3;
	}
	if (warp == true && _root.warpframe == false) {
		if (warpnum == 1) {
			_root.attachMovie("lefttransition", "lefttransition"+_root.getNextHighestDepth(), _root.getNextHighestDepth(), {_x:_root.screensizeX/2, _y:_root.screensizeY/2});
		} else if (warpnum == 2) {
			_root.attachMovie("lefttransition", "lefttransition"+_root.getNextHighestDepth(), _root.getNextHighestDepth(), {_x:_root.screensizeX/2, _y:_root.screensizeY/2});
		} else if (warpnum == 3) {
			_root.attachMovie("lefttransition", "lefttransition"+_root.getNextHighestDepth(), _root.getNextHighestDepth(), {_x:_root.screensizeX/2, _y:_root.screensizeY/2});
		}
		warp = false;
	}
	if (_root.warpframe == true) {
		if (warpnum == 1) {
			_root.changecourse("lefttransition2", "3-4", 2350, 30, 2350, 30);
		} else if (warpnum == 2) {
			_root.changecourse("lefttransition2", "3-2", 2350, -70, 2350, -70);
		} else if (warpnum == 3) {
			_root.changecourse("lefttransition2", "3-8", 0, 0, 0, 0, true);
		}
		//_root.warpframe = false;                    
	}
	// 
	if (_root.PauseGame == false) {
		if (_root.Course.Char._y-_y<1600) {
			//
			if (_root.Metal == false && _root.Invincible == false && _root.Invisible == false) {
				if (hit == false) {
					_root.HazymazeCaveSongChange(0);
				}
				hit = true;
			}
			//      
		} else {
			if (_root.Metal == false && _root.Invincible == false && _root.Invisible == false) {
				if (hit == true) {
					_root.HazymazeCaveSongChange(1);
				}
				hit = false;
			}
		}
	}
};

onClipEvent (load) {
	_visible = false;
}
onClipEvent (enterFrame) {
	if (this.hitTest(_root.Course.Char.charClip.body)) {
		if (_root.PauseGame == false && _root.playpause == false) {
			//_root.Course.Char.yspeed = _root.groundFriction(_root.Course.Char.yspeed, 0.015, 1.001);
			if (savezoom == undefined) {
				savezoom = _root.CameraZoom;
			}
			if (_root.CameraZoom>80) {
				_root.CameraZoom -= 1;
			}
		}
	} else {
		if (savezoom !== undefined) {
			if (_root.CameraZoom<savezoom) {
				_root.CameraZoom += 1;
			} else {
				savezoom = undefined;
			}
		}
	}
}

onClipEvent (load) {
	DirectionX = "Right";
	DirectionY = "Down";
	distanceX = 80;
	distanceY = 0;
	accelX = 0.3;
	accelY = 0;
	speedX = 2;
	speedY = 0;
}

onClipEvent (load) {
	DirectionX = "Left";
	DirectionY = "Down";
	distanceX = 80;
	distanceY = 0;
	accelX = 0.3;
	accelY = 0;
	speedX = 2;
	speedY = 0;
}

onClipEvent (load) {
	DirectionX = "Right";
	DirectionY = "Down";
	distanceX = 80;
	distanceY = 0;
	accelX = 0.3;
	accelY = 0;
	speedX = 2;
	speedY = 0;
}

onClipEvent (load) {
	DirectionX = "Left";
	DirectionY = "Down";
	distanceX = 80;
	distanceY = 0;
	accelX = 0.3;
	accelY = 0;
	speedX = 2;
	speedY = 0;
}

onClipEvent (load) {
	//example   = "You can jump in the cannon\nand blast off!";
	signmessage = "Don't Look Down!";
}

onClipEvent (load) {
	starfunction = function () {
		_root.StartNewMusicAndIntroNoVar("MetalCap - Intro", "MetalCap - Repeat");
		_root.PowerTimer = 32*30;
		_root.Metal = true;
	};
}

onClipEvent (load) {
	starfunction = function () {
		_root.StartNewMusicAndIntroNoVar("WingCap - Intro", "WingCap - Repeat");
		_root.PowerTimer = 32*30;
		_root.Invisible = true;
	};
}
